(380, 'Audience', 'Vote', NULL, '', '', '', 'Win two tickets to any \"Festival Gegen den Strom\" concert by taking part in our competition. If you correctly predict who the three winners will be in the correct order, you will win the competition.', 'Simply write in the comments:\r\n1st Prize: -Name of Finalist-\r\n2nd Prize: -Name of Finalist-\r\n3rd Prize: -Name of Finalist-\r\n', '');
INSERT INTO `comments` (`id`, `userID`, `applicID`, `comment`, `createdOn`) VALUES
(7, 7, 6, 'Une voix angélique et tellement puissante', '2021-03-22 20:02:21'),
(8, 11, 35, 'Καταπληκτική φωνή! Όμορφη, σεμνή παρουσία, εκφραστική ερμηνεία, υπέροχη άρθρωση, που σε κάνει να ακούς κάθε λέξη κι ας είναι σε ξένη γλώσσα, απαλές κινήσεις, μελωδικότατη φωνή που ευφραίνει καρδιά και νου. Γενικά, δεν χορταίνεις να ακούς και να βλέπεις αυτήν την ερμηνεία! Πολλά πολλά εύγε!', '2021-05-01 10:37:07'),
