(203, 228, 27, 'I love your voice quality and your style, reach in nuances.  I hope you are coming back to Italy for a concert! ', '2021-05-04 16:18:05'),
(204, 229, 27, 'Ricarda sung with delicate elegance and unwavering beauty of sound. A powerful voice combined with magnetic stage presence. Just wonderful!', '2021-05-04 16:53:27'),
(205, 230, 68, 'So powerful voice in such a brilliant lady', '2021-05-04 17:13:36'),
(206, 231, 35, 'Absolutely beautiful voice and could understand the sentiment of the song by Katerina’s beautiful performance ????', '2021-05-04 18:54:09'),
