(208, 233, 57, 'Très belle voix, j\'aime beaucoup.', '2021-05-04 20:03:26'),
(209, 236, 59, 'Che bella voce.! ❤️ ', '2021-05-04 21:03:16'),
(210, 235, 68, 'Such a beautiful voice!She also has wonderful taste,she is expressive and so charming!', '2021-05-04 21:30:44'),
(211, 237, 60, 'Sara has such a beautiful voice! She should be on Broadway! Bravo ???? ', '2021-05-04 21:58:59'),
(212, 238, 68, 'A very talented persona and a gifted voice!', '2021-05-04 22:31:11'),
(213, 6, 11, 'PASS\r\nAVI KLEMBERG LEADS HIS VOICE WITH CONCENTRATION AND THE TONE IS ADAPTED TO ITALIAN REPERTOIRE\r\nNICE INTERPRETATION OF MACDUFF’s Aria even if it s\r\nA little\r\nTo slow ', '2021-05-04 22:34:46'),
(214, 6, 11, 'PASS\r\nAVI KLEMBERG LEADS HIS VOICE WITH CONCENTRATION AND THE TONE IS ADAPTED TO ITALIAN REPERTOIRE\r\nNICE INTERPRETATION OF MACDUFF’s Aria even if it s\r\nA little\r\nTo slow ', '2021-05-04 22:35:33'),
(215, 240, 27, 'Diese Stimme lässt keine Wünsche offen. Ein warmer Mezzosopran mit strahlender Höhe und ausgeglichenen Registern, dabei perfekt intoniert und facettenreich. Sicher in Stil und Phrasierung. Bitte mehr davon! Toi Toi Toi aus Zürich', '2021-05-04 23:13:28'),
(216, 241, 18, 'Always moving Kristin- great job!', '2021-05-05 01:07:07'),
(217, 243, 68, 'Such a powerful and beautiful voice. It’s an absolute pleasure to hear her sing! ', '2021-05-05 03:44:29'),
(218, 246, 27, 'Beautiful singing of an excellent aria. \r\n', '2021-05-05 12:42:49'),
(219, 248, 28, 'She was my favortite. The song really suited her voice. Awesome job! Keep up the good work', '2021-05-05 13:33:09'),
(220, 245, 49, 'Bravo! enchanting voice', '2021-05-05 14:53:26'),
(221, 250, 13, 'Absolutely exquisite performance! It is clear Kelly has had superior vocal training and has a clear command of her voice. She strikes me as being the excellence of execution, both in vocal and acting technique. She creates a character with a clear and powerful arc from beginning to end with not only a wide vocal range and levels but with her body language, emotion and change in tones. You really FEEL her character\'s pain and torment as well as her courage at the end. Bravo! ', '2021-05-05 16:13:11'),
(222, 51, 27, 'I am overwhelmed by the applause, votes and support i am receiving since this Grand Prix started! It’s just incredible and such an enormous motivation and a wonderful gift especially in this time! Thank you so much, you are all amazing! What a wave of positive energy, love and happiness. Grazie di cuore a tutti, Danke und Merci :*', '2021-05-05 17:14:07'),
(223, 251, 35, 'It sounds like a bird of paradise, singing opera!!! Just Perfect ! ', '2021-05-05 17:36:09'),
