(254, 0, 10, 'Beautiful rendition - looking forward to more!', '2021-05-08 13:17:11'),
(255, 305, 35, 'Thank you VERY much all for your beautiful, heart-warming comments!  I\'m afraid I don\'t have the possibility to write after each and every comment here, but you really made my soul smile and my heart sing!  The musical \"journey\" to this competition may have ended for me here, but always remember what K.P.Kavafis wrote \"It\'s the journey that counts the most and not the destination itself\"!  Of course, I would love to go on further, but during this very process I personally earned many things, which I am trying and I will continue trying to develop.  And, above all, I earned all the human feelings you all helped me develop.  Of course, the most important part would be for me to be able to receive a certain feedback from the members of the jury, in order to become more competent in this demanding field I prefer the most of all: classical singing.  I\'m afraid this is difficult to happen because of the number of the contestants, though, so I really thank every member of the jury that took the time to watch my video, wishing all the best for the rest of this competition and not only.\r\nReturning back to you, dear friends, either you know me better or not, I wish you all the best in every aspect of your lives.  Keep being so positive and I\'m sure that life is going to bring you the best!!!\r\nWith honour and a big smile,\r\nKaterina Makri', '2021-05-08 15:25:35'),
