(280, 81, 244, 'Such incredible performances! You sing Hofmann with ease and your character is intriguing. Your voice shines in this piece.  Looking forward to hearing do this role. And your German lied is incredibly sung and your ability to tell a story with text and phrasing and dynamics is fantastic. I can listen to your gorgeous voice all day. :) ', '2021-05-22 09:49:16'),
