(310, 461, 223, 'Dear contestants,\r\n\r\nI have noticed, that: 1) there is “dead end” on the contact link for the technical support of this website. 2) to every contestant: if “viewed” means the opposite of “pass”, how come on many contestants’ pages the ratio of “viewed” and “pass” does not match to the overall results? \r\n\r\nThis is unfair to all the singers who put so much talent, work, dedication, and hopes to get the fair response and fair results showed on the website. I believe that the technical support team is not doing satisfactory job, or is not honest.\r\n\r\nSincerely,\r\nIsaak Vasserman\r\nIsaak.vasserman@yahoo.com', '2021-05-24 23:07:21'),
(333, 5, 223, 'Mr Vasserman,\r\nWe have received no email from you.  As has been explained to the contestants, the pass button and the \"Pass\" and \"Viewed\" comments are an indication to where the results are going and not the final result.  The final result will be announced after I speak with all the judges and confirm their decisions as final.  Contestants are aware that points may change upward or downward.  I hope this satisfies your questions and our job as a tech team.  \r\nSincerely, Philip Modinos mphilippos@hotmail.com', '2021-05-25 00:29:01'),
(334, 142, 255, 'Beautiful voice! And considering this singer is an Alto thought she sang the Violin Aria very well, showing the many colours in her voice. Her rich deep timbre over a vast vocal range is something special ', '2021-05-25 11:45:49'),
