(384, 13, 70, 'Pass.  A difficult aria which displays the ability to turn the voice and has difficult coloratura which is well executed.  I advise that more care is taken with sound in recordings, as certain mic settings are not doing you justice, which may have dissuaded the other judges from voting for you.  ', '2021-05-05 20:37:32'),
(385, 13, 10, 'Pass.  A beautiful video.  I\'d like to see what else she will offer.', '2021-05-05 20:39:10'),
(386, 13, 29, 'Viewed.  You\'re heading in a good direction and your high notes are quite impressive.  There are various imperfections and stylistic mistakes that make it difficult to give a pass, considering some of the other contestants.  However, I can see you doing well in competitions in the future.  If I were you, I\'d research more on freedom of breath.  ', '2021-05-05 20:46:28'),
(387, 13, 65, 'Pass', '2021-05-05 20:48:50'),
(388, 13, 15, 'Viewed.  There is competence in the singing, security and good intonation.  There is something about the general placement of the voice that doesn\'t sit well with me.  Considering some of the other contestants I can\'t offer a pass.  But still, it\'s a pretty competent execution and well acted.', '2021-05-05 20:53:09'),
(390, 13, 71, 'Viewed.  Intonation and overall technique is alright.  Pronunciation needs work.  I think, however what creates the most problems for you is your choice of environment for the recording.  Opera singing is very much about projection and getting that  accross on a mic (without it clipping) can be tricky.  However,  in a very small room like that, it would be impossible to sing with proper projection and getting energy accross.  What you should take away from this is that singing well is one thing... proper recording conditions is something else entirely.  Singers today should learn what the best recording conditions are.', '2021-05-05 20:59:04'),
(391, 13, 45, 'Pass.  Excellent video and interpretation.   I hope you have something more challenging for the coming rounds.', '2021-05-05 21:21:53'),
(392, 13, 12, 'Pass.  You\'re a very good singer.  I believe that the other judges were affected by the fact that this is a cell-phone video that\'s standing upright and that you\'re not really \"dressed for the occasion\".  If you pass to the next round, please wear something nicer (and the pianist as well) and place your phone to the side, so that the video is full screen.  ', '2021-05-05 21:26:13'),
(393, 13, 62, 'Viewed.  The video is great and intimate.  The sound of the voice in the higher register is velvety and smooth.  I really loved the feeling I got from listening.   I don\'t offer a pass because there are technical weaknesses that come through in the low notes.  My personal view is that you\'re taking a very open approach, especially to the vowel \"E\" and you\'re losing air and resonance.  If you sort out these issues, you\'ll be in great form to win competitions and auditions.', '2021-05-05 21:33:46'),
(394, 6, 59, 'Viewed\r\nIOANNA CHR.TSILIGMIGKA CAN HAVE A MELODIOUS\r\nVOICE BUT SHE HAS TO CONCENTRATE HER SOUNDS AND THINK\r\nABOUT\r\nPHRASES LINES AND NOT ONLY NOTES ', '2021-05-05 21:51:13'),
(395, 6, 50, 'PASS\r\nANGEL\r\nVARGAS HAS A NICE COLOR OF TÉNOR VOICE SOMETIMES HE LOSES\r\nTHE LEGATO AND THE SOUNDS BECOME\r\nHARD\r\n', '2021-05-05 21:55:10'),
(396, 13, 2, 'Viewed.  I can hear the intention in your singing.  It\'s really going somewhere.  I can\'t offer a pass because there are technical issues... in particular freedom of breath and resonance in the lower register.  Your top notes are your best feature.  If you develop your technical mastery a bit more, you\'ll be on your way for better results.  ', '2021-05-05 21:58:59'),
(397, 6, 34, 'PASS\r\nEmma Wheeler has a nice voice\r\nFor Stephano but a\r\nLack\r\nOf\r\nGood\r\nFrench pronunciation and always fa# out of tune ', '2021-05-05 22:03:17'),
(398, 13, 8, 'Pass.  Good video and good mic and sound settings.  Nice technique with even resonance.  My only criticism is that some of your coloratura was out of tune momentarily.  Also, when you do coloratura you don\'t use the same quality of technique and sound as you do during the rest of your singing.  It falls into a bit of a caprile, which I believe you should rethink... although, I\'ve heard people make great careers in spite of this type of coloratura approach... so its subjective.  Still, a solid pass.', '2021-05-05 22:05:45'),
(399, 6, 54, 'VIEWED \r\nZACHAROULA XESFIGKOULI HAS A INTERESTING\r\nPOTENTIAL VOICE FOR\r\nSOPRANO NOW\r\nSHE HAS TO EQUAL EVERY SOUND EVERY VOCAL AND WORK ON LEGATO', '2021-05-05 22:09:45'),
(400, 6, 66, 'PASS\r\nNICE INTENSITY FOR CHARLOTTE’s\r\nSometimes\r\nWe\r\nLose\r\nThe comprehension of the French text', '2021-05-05 22:14:32'),
(401, 13, 42, 'Viewed.  I appreciate the musicality and the intention behind the aria.  I can see that there\'s real affection for the aria and I can discern that this could be an exciting interpretation if it was backed by a wholesome technique.  The main issue with the technique is that the breath doesn\'t develop enough speed and most of the resonance happens in the carotid.  There is soul in the singing.  Technique needs to be rethought.  Still, well done.', '2021-05-05 23:41:17'),
(402, 13, 25, 'Viewed.  First of all, I your presentation is excellent on all counts.  You\'ve dressed up for the occasion, you\'ve created a nice video with good sound.  \r\nNow, why not a pass... You have a solid technique, although there is something that bothers me with your vibrato which I can\'t put my finger on through the recording.  \r\nBut the main reason... and I don\'t know if this will mean anything to you... your \"planning\" in your music seems to be happening as you go along.  I feel like you should be planning your phrases in bigger chunks... like if you have a 3 bar phrase, plan for everything required from the in breath.  And then expand that way of thinking to a page... and to the whole piece.  \r\nI realise that at first glance what I\'m saying here will not make much sense to you, and may feel like an unfair assessment, and I\'m sorry... but maybe in a couple of months you\'ll try and sing something and this advice might pop into your head and do something for you... it might even take away that thing I can\'t pinpoint on the vibrato that I\'d change if it were up to me.  \r\nAgain, really nice presentation overall.  ', '2021-05-05 23:52:12'),
(403, 13, 67, 'Viewed.  OK, so here we have all the ingredients, but it\'s all at about 50% of where it needs to be.  Which means you seem to have all the correct intentions in music, technique and language, but you\'re not accomplished enough yet, which also seems to be making you nervous during this performance.  There are some Italian errors that will probably have bothered my Italian colleagues.  My view is that you should keep doing what you\'re doing and wait for time and friction with the art get you there.  This two years from now would probably get all votes.  Your camera was shaky.  ', '2021-05-05 23:59:45'),
(404, 13, 58, 'Viewed.  I was torn for a bit and almost gave you a pass.  But I have to be fair to the fact that there are other more accomplished people in the competition.  You\'ve really done well though, you have a solid technique and precision.  I\'m not passing you because it is visible that you are inexperienced.  You need to discover the intention behind the music and have the courage to make it your servant instead of a \"do what the teacher told me\" approach.  But \"do what the teacher says\" is at this stage your best chance at improving, which is why I can\'t pass you, as you\'re not accomplished enough yet to have the confidence to \"not listen to the teacher\" anymore.  \r\nAlso, your choice of room was not so good, a better room might have covered for some of the weaknesses.  \r\nFinally, you should learn to have a relationship with the camera.  Charming us would\'ve also helped to cover for some of the weaknesses.  Still a good attempt.  Keep at it.  Before you know we\'ll be begging you to sing for us.', '2021-05-06 00:08:45'),
(405, 13, 21, 'Pass.  Very accomplished.  Good presentation.  No need to say much.  Well done!  ', '2021-05-06 00:12:29'),
(406, 13, 43, 'Pass.  Full and even.  Ran out of breath at one phrase,  but other than that, accomplished.  When using mobile phones, perhaps look into how you can record with the phone to the side so that it will fill the screen for the video.  Also, even though you dressed for the occasion, maybe create a better scenery for us.  ', '2021-05-06 00:17:31'),
(407, 13, 72, 'Viewed.  With 4 votes and a very high \"applause\" it looks like you\'re going to the next round, but I won\'t give you a pass for a particular reason.  You\'re very good, don\'t get me wrong.  And I won\'t offend you by saying you\'re \"talented\" (which often implies lack of deliberate technique).  The reason I\'m not passing you is that the lack of experience shows in particular moments, especially in the lower register as well as some of the coloratura.  It\'s like you\'re really focused on getting right where its \"hard\" and then other bits don\'t get the same attention.  I\'d say you\'re abou 80% there though.  Probably this time next year, two years tops (with a bit of luck and the will of the fates) you\'ll be making headlines.  Best of luck!!', '2021-05-06 00:29:54'),
(408, 13, 38, 'Viewed.  The video is good.  The technique is solid.  The piece isn\'t super challenging, although it has some good coloratura.  My main concern is that there is a small orchestra in a pit and there are moments when the orchestra covers you.  Now don\'t get me wrong, I appreciate your well executed performance, but I feel that when comparing with some of the other contestants, I\'m not feeling a pass.  Still, you\'re probably getting to the next round, so if you do, make sure we hear more of your register and that you\'re not covered by the orchestra or piano.  ', '2021-05-06 00:37:25'),
(409, 13, 49, 'Viewed.  Excellent musical skill and interpretation.  An accomplished performer in many ways.  It\'s not a pass from me because the techique seems to have solidified in a non resonant position.  I really feel that if you look for better breath and more resonance you would have the whole package.  ', '2021-05-06 01:03:15'),
(410, 13, 61, 'Viewed.  The video and choice of piece as well as the edit in the middle are really what\'s hurting you here.  The voice does come through over the orchestra, although there seems to be amplification, which is really making it difficult to judge what\'s going on.  Even though the intensity of the music gives a sense of \"difficulty\" when it\'s all done and dusted, it\'s not a very challenging piece.  It\'s difficult to discern if you\'re accomplished or not through this video.  ', '2021-05-06 01:09:28'),
(411, 13, 13, 'Pass.  An accomplished performance.  My only objection is the parlato \"make you understand\" which felt a bit forced (interpretation wise).  I would advise to look into more melodic mainstream repertoire for the next round.  ', '2021-05-06 01:16:23'),
(412, 13, 24, 'Viewed.  \r\nThe performance isn\'t bad or anything, you do well, you get the crowd excited and you sing while doing moves.  \r\nA first problem is that singing opera with a mic attached to your face means you can\'t really project, as the mic will clip, which immediately alters your singing technique and even causes slight intonation problems.\r\n\r\nA second problem is that some of the moves, especially the clapping, get you out of breath eversoslightly.  \r\n\r\nA final problem is that the piece isn\'t super challenging, which means that its difficult to show leniency to the other two points.  \r\n\r\nI\'m afraid that the choice of video is not so good for the competition.  You\'re clearly doing well in the video... the performance is sound and the people are into it... but in a competition where virtuosity is a factor, there are too many faults to ignore.  Still, it was enjoyable.', '2021-05-06 01:25:15'),
(413, 13, 18, 'Pass.  Its a pretty accomplished voice and a nice video and good sound quality.  ', '2021-05-06 08:10:08'),
(414, 13, 27, 'Pass.  Very Accomplished', '2021-05-06 08:16:17'),
(415, 13, 46, 'Pass.  This is a very accomplished singer, including her ability to convery emotion with her body.  I would rethink my mic and sound settings if I were you.  The room creates a resonance that could be doing you injustice.  ', '2021-05-06 08:21:21'),
(416, 13, 51, 'Viewed.  First of all, it\'s a very good video and a good sound.  Also, you convery much emotion with your body.  Its not a pass from me because there is something in your vibrato which I think needs rethinking.  Other than that its a very accomplished performance.  ', '2021-05-06 08:27:30'),
(417, 13, 19, 'Pass.  Accomplished and even voice.  Very small problems in the coloratura, which is truly difficult though, and would mess with the best of them.  ', '2021-05-06 08:34:55'),
(418, 13, 28, 'Pass.  Very accomplished and even.  Nice background and presentation.  You MUST rethink your sound settings.  ', '2021-05-06 08:38:12'),
(419, 13, 47, 'Pass.  An accomplished singer.  And even though you dressed well, you have to rethink the background.  But the real issue which I think cost you the other judge\'s vote is your sound settings.  You mic is clipping (if you sing too loud it distorts) and the piano is creating a bad resonance.  ', '2021-05-06 08:42:07'),
(420, 13, 23, 'Pass.  Very accomplished singer.  Soulfull interpretation.  A bit too much reverb in the room.  ', '2021-05-06 08:44:51'),
(421, 13, 64, 'Viewed.  So... The sound is good and even.  The intent behind the music is very present.  BUT... there are some serious phrasing issues.  About 30% of the time, phrases get cut off... or pronunciation is misplaced.  I think if you rethink some of that, you could be a real contender soon.', '2021-05-06 08:49:25'),
(422, 13, 52, 'Viewed.  The recording is very bad and makes it very difficult to see or hear anything.  What does come across is quite good, and the only criticism I can make from the little that I can hear is that you\'re unsure about when to turn your voice when you in the mid higher register.  \r\nIf you record with mobile phone, learn how to do it with the phone to the side so that you can fill the screen.  ', '2021-05-06 08:54:54'),
(423, 13, 20, 'Viewed.  There is some accomplishment in the singing of this aria, I can hear all the words.  I feel like turning the voice would make your singing a lot easier.  Still an enjoyable performance.  ', '2021-05-06 08:59:09'),
(424, 13, 60, 'Pass.  VERY accomplished.  Pretty good presentation and sound as well.  I suggest something more melodic and mainstream for the next rounds.  ', '2021-05-06 09:03:46'),
(425, 13, 11, 'Pass.  It\'s really good in many ways.  There is precision, good intonation and generally an accomplished performance.  You\'ve added some artificial reverb, but I suspect your dry/wet settings are wrong,  which is creating a weird effect, as the original recording seems to be pretty dry.  ', '2021-05-06 09:14:13'),
(426, 13, 41, 'Viewed.  There is a soulfulness to your singing.  There are moments in particular notes when the voice clicks into the right position and sounds impressive.  Unfortunately, taking into account some of the other contestants, I can\'t give a pass.  ', '2021-05-06 09:19:58'),
(427, 13, 6, 'Viewed.  This is a performance in which one can discern that you\'re well prepared and are really pushing yourself to take the world by storm.  The presentation is very nice.  You\'re very close to the Mic and that creates extra problems for you.  A mic for classical singing should be no less than 1.5 meters away and sometimes it serves better for the mic to be even further.  You\'re generally heading in the right direction, but considering some of the other contestants I can\'t give you a pass.  ', '2021-05-06 09:25:18'),
(428, 13, 14, 'Viewed.  Very good presentation... wonderful acting.  Why not pass:  You\'re doing everything you need to do I feel, which includes technique, interpretation, pronunciation.  However, the cake is still baking.  The ingredients are there.  Give it a bit more time and you\'ll be great.  ', '2021-05-06 12:16:17'),
(429, 13, 7, 'Viewed.  The presentation is good.  The voice gets overwhelmed by the piano in places by the recording.  The voice is there, but it needs to resonate better and it also needs to be have a looser breathing technique.  There is some insecurity with the music,  in particular some of the coloraturas.  It can\'t be a pass because of the level of some of the other contestants.  ', '2021-05-06 12:21:12'),
(430, 13, 55, 'Pass.  Wow!! Now there\'s an alto!', '2021-05-06 12:25:56'),
(431, 13, 35, 'Viewed.  The musicality is there and the video is pretty good and there is also resonance, but the breath is not functioning as it should.  Relaxation techniques might make things better.  ', '2021-05-06 17:28:00'),
(432, 13, 57, 'Viewed.  Please don\'t misunderstand me... the voice is even and well placed.  Understanding of the music and the words is also very good.  There is a tiny bit of maturing still required in your breath control.  But, a you\'re really good.  ', '2021-05-06 17:31:23'),
(433, 13, 68, 'Pass.  Very accomplished!', '2021-05-06 17:34:14'),
(434, 13, 4, 'Pass.  If I\'m being picky, there are moments in which some of the vowels in Italian aren\'t correct.  But there is no doubt that there is mastery here... Intonation is good and expression is also convincing.  I think it deserves a pass.  Please rethink the jeans and also sound settings, which are affected by the room you\'re in.  ', '2021-05-06 17:39:04'),
(435, 13, 53, 'Pass.  The video is excellent.  The piece is very difficult and in the context of pressure of such an event with TV and everything, that makes it even more impressive.  Minor intonation issues which I feel can be overlooked at this instance.  ', '2021-05-06 17:42:37'),
(436, 13, 16, 'Viewed.  The voice is very beautiful and has a luscious darkness to it at times.  Insecurity comes across when going to the top register and the singing some time lacks phrasing.  There is an understanding of mixing and turning the voice, though, but not totally secure.', '2021-05-06 17:45:59'),
(437, 13, 48, 'Pass.  I hear a lot of accomplishment here.  I think that the drawback is that a lot of the time you seem to keep your mouth too closed creating a distinctive resonance.  But the ability to visit the top and the musical intent is there in my view.  ', '2021-05-06 17:51:09'),
(438, 13, 40, 'Viewed.  Ingredients are there, there is good resonance.  Your lower register isn\'t at its fullest... mostly your breath control seems a bit under construction still.  Finally, CHARM!  Charming us will come through in the voice as well.  Think about it.  It\'s not about getting technique and notes only.', '2021-05-06 17:54:05'),
(439, 13, 1, 'Pass.  This is, imhv, a mezzo with some real potential.  Adalgisa is hard!!  And this is done in a context of pressure in a theatre and the voice comes through.  The voice has a sweet velvet sound, which I really liked.  The only thing that perplexes me is that there are a few moments of pronunciation problems in the Italian... But a solid Pass from me.  ', '2021-05-06 17:59:36'),
(440, 13, 36, 'Pass.  Very solid, well done.  I agree with Richard about some insecurity with the top.  Other than well done!', '2021-05-06 18:01:53'),
(441, 13, 39, 'Viewed.  The rep is correct... the musical intention is also correct.  The top is very good.  However, you get away from each other a couple of times.  If I had to give some technical advice... I\'d say you need to come into better contact with your chest voice and mix more.  We get a lot of head and the vibrato has some caprile characteristics.  It\'s a good video, don\'t get me wrong, but these things would have to be sorted.  ', '2021-05-06 18:14:53'),
(442, 13, 17, 'Pass.  Very accomplished.  Hard piece.  Well delivered.', '2021-05-06 18:19:45'),
(443, 13, 37, 'Pass.  I thought this was an accomplished performance.  I feel like diction could use some retraining.  Good Breath control.  The accoustic of the room made some things blurry.  But still, a solid pass from me.', '2021-05-06 18:24:02'),
(444, 13, 3, 'Pass.  Solid on all levels and good video.', '2021-05-06 18:26:04'),
(445, 13, 63, 'Pass.  I agree with Richard that there\'s something going on with a certain aspect of your voice... that affects the vibrato.  But I can\'t ignore all the accomplished skill I see in everything you\'re doing right.  So, it\'s a pass from me.  ', '2021-05-06 18:31:27'),
(446, 0, 69, 'Pass.  Apart from the final top note which wasn\'t \"perfect\" this was a very good video.  Always, the context of the pressure of a live performance with TV there, has to be taken into consideration.  Under such pressure, this is a very good performance.', '2021-05-06 19:56:53'),
(447, 13, 69, 'Pass.  Apart from the final top note which isn\'t \"perfect\" this is a very good performance.  We must always take into consideration that the pressure of a live performance with TV present has to be taken into consideration.  This is a strong contender.  ', '2021-05-06 19:58:57'),
(448, 13, 26, 'Pass.  My greatest criticism is that you are constantly using a dark vowel creating a \"dome\" sound like you\'re in a cave of something.  But this is a very accomplished performance and the amount of energy you manage to get across through a video in a living room... That\'s worth a pass from me!', '2021-05-06 20:04:33'),
(449, 13, 32, 'Pass.  An accomplished performance.  Well done!', '2021-05-06 20:06:51'),
(450, 13, 44, 'Viewed.  It\'s a compelling performance in many ways.  I feel like the placement of the voice needs to include more chestvoice.  This in turn would make some of those held mid/high range notes a little easier.', '2021-05-06 20:11:36'),
(451, 13, 5, 'Pass.  OK, I gotta give this a pass, because it\'s under pressure of audience and there are some very impressive things happening here.   The final note was good.  However, the videos for further rounds need to be better and the camera should be from the front.  It was written in the terms and conditions that judges will be affected by what they see and quality of video.  I think this is something you should consider here.  ', '2021-05-06 20:17:44'),
(452, 13, 22, 'Viewed.  You have a lot going for you.  Difficult to pass you because there are particular ingredients that need work.  The most important are:  You\'re using mostly the top part of your voice and not using the chest almost at all.  And:  Your pronounciation of Italian needs work.  Its still a very good performance.  ', '2021-05-06 20:22:41'),
(454, 13, 9, 'Pass.  Excellent.  But I agree with Annegret Ritzel about hyperaccoustics.  Please make sure that your next has sound better taken care of and that the piano is further from the mic than you.  ', '2021-05-06 20:29:09'),
(455, 13, 31, 'Viewed.  The resonance is even throughout the voice, which is a big plus.  There are some pronounciation issues as well as phrasing.  There is musical intent, but its not supported by the use of breath in the phrases.  ', '2021-05-06 20:33:00'),
(456, 13, 59, 'Viewed.  This is a very good performance and has all the ingredients for a pass at about 80%.  You still need some refinement to compete with some of the other people here, but you\'re not far.  I think in future competitions and auditions maybe a year from now, you\'ll be in good form.  ', '2021-05-06 20:37:45'),
(457, 13, 50, 'Pass.  A solid performance.  Cadenza was a bit sharp.  ', '2021-05-06 20:40:16'),
(458, 13, 34, 'Pass.  This is a solid performance.  Some intonation issue, which are minor.  ', '2021-05-06 20:42:39'),
(459, 13, 54, 'Viewed.  I think your greatest problem is the room you chose.  The hyperaccoustics of the room make it very difficult to hear what you\'re doing.  It makes a sound that might be pleasant sound unpleasant.  It\'s unfortunate, but accoustics and sound settings play a vital role in these videos.  ', '2021-05-06 20:45:54'),
(460, 13, 66, 'Pass.  Very good video on all fronts.  Draws you in with her performance.  ', '2021-05-06 20:49:25'),
(461, 4, 25, 'Viewed', '2021-05-07 09:30:00'),
(462, 5, 70, 'Viewed.', '2021-05-07 09:31:05');
