(463, 13, 30, 'Pass.  I give this a pass, because I can hear that there is a big, comfortable voice throughout the register.  Richard makes a fair assessment, though and to this I have to add that it\'s risky to overdo it with charm - however enjoyable - when in a competition.  The greatest drawback in this instance has been the fact that the verses would fall out of tune at places.  On the other hand, the descending chromatic scales were very precise, so I believe that baring this in mind, the singer might have more to offer in subsequent rounds, although by the looks of it, that won\'t happen.', '2021-05-07 10:05:40'),
(464, 4, 52, 'Viewed', '2021-05-07 10:08:15'),
(465, 13, 56, 'Pass.  A very accomplished performance.  Hoping to hear something more challenging in subsequent videos.', '2021-05-07 10:10:43'),
(466, 13, 33, 'Pass.  I find this a very competent performance.  ', '2021-05-07 10:18:58'),
