(689, 15, 336, 'Bizet\r\nNice sound.  Pretty good French with minor imperfections.  Some pitch problems in the faster section.  The high note had a small loss of control at the end.\r\n\r\nRossini\r\nVery good precision and diction.  High notes quite impressive.  The “Figaro, Figaro…” variation needs to be a bit more thought through.  Strong performance overall.\r\n\r\nOffenbach\r\n\r\nNice technique overall.  The interpretation could’ve benefited from a lighter approach.  Perhaps if it was sung a bit slower.  The high note during the second go was better as far as the interpretation goes, but some technical weaknesses were discernible as a result.  \r\n\r\n', '0000-00-00 00:00:00'),
(690, 15, 350, 'Massenet:  \r\nNice technique overall, with a sweet tenor sound.  Some diction problems and the A# was a bit sharp both times.  However, the interpretation was convincing.\r\n\r\nPuccini:  \r\nOverall very well done.  Good Italian, nice top Bb, good interpretation, and a solid top C, albeit with a bit of anxiety about it being visible.  \r\n\r\nOffenbach:  \r\nGood sound and the interpretation is very convincing.  The diction seems to be better than in the Massenet, probably a matter of tessitura.  ', '0000-00-00 00:00:00'),
(691, 15, 353, 'An overall comment is that sound settings are very low for Delibes and Verdi.  \r\n\r\nDelibes:\r\n\r\nOverall a very strong performance.  There are minor imperfections in some coloratura, however it does not detract from the whole.  Technique is easy and flowing, diction is good and interpretation is engaging.\r\n\r\nVerdi:\r\n\r\nAgain, a strong performance with a few imperfections in pitch.  What stands out is the ease of pp in the higher register.\r\n\r\nOffenbach:\r\n\r\nThis provides a nice contrast when it comes to interpretation to the other pieces.  It shows another side of the singer, where the energy is more intense and more humorous.  Also, the sound settings are better in this instance.\r\n', '0000-00-00 00:00:00'),
(692, 15, 356, 'An overall comment is that sound settings are very low.  \r\n\r\nGounod:\r\n\r\nVery good precision in pitch and good diction.  \r\n\r\nLeoncavallo:\r\n\r\nLower notes need some fleshing out.  During the bird imitation the two high notes need to be in passing and not so “positioned” and intense.  Some pitch issues in higher register, which may be happening as a byproduct of sound settings.  \r\n\r\nOffenbach:\r\n\r\nVery nice precision and diction.  Again some problems with pitch in higher register.  Musically some greater contrasts between p f would’ve perhaps enhanced the performance.  \r\n', '0000-00-00 00:00:00'),
(693, 15, 365, 'Poulenc:\r\n\r\nExcellent technique and precision, and diction.  The interpretation in some instances is held back… especially in some descending coloratura, where perhaps it should’ve imitated laughter.\r\n\r\nHändel:\r\n\r\nVery nice tone.  And the interpretation is very spot on.  The Italian isn’t bad, but it’s discernible that it’s not the first language.\r\n\r\nOffenbach:\r\nAgain, technique is excellent.  Being overly critical, legato seems to be missing in some of the coloratura, however, this could be attributed to interpretation of giving a “mechanical” feel to the doll.  Very impressive variations!\r\n', '0000-00-00 00:00:00'),
(694, 15, 372, 'Donizetti:\r\n\r\nVery good energy and interpretation!!  Some very small technical imperfections, that are mentioned only in context to competition and would not be mentioned otherwise.  \r\n\r\nBellini:\r\n\r\nPrecision is good for the most part.  Some imperfections when it comes to chromatic scales.  Good diction.\r\n\r\nOffenbach:\r\n\r\nAgain, very nice energy and good precision in coloratura.  Diction is good.  \r\n', '0000-00-00 00:00:00');
